import React, { Component } from 'react'
import { Layout } from 'antd'

const { Sider, Content } = Layout;

export default class App extends Component {
    render() {
        return (
            <div>
                <Layout className="container">
                    <Sider defaultCollapsed="true" collapsedWidth="68">Sider</Sider>
                    <Layout>
                        <Sider className="contast-list" defaultCollapsed="true" collapsedWidth="251" theme="light">
                            这里展示聊天联系人
                        </Sider>
                        <Layout>
                            <Content>Content</Content>
                        </Layout>
                    </Layout>
                </Layout>
            </div>
        )
    }
}
